import React, { useEffect, useState } from "react";
import Navigation from "../../Navigation/Navigation";
import Card from "../../UI/Card/Card";
import Classes from "../Yearly/Yearly.css"

const Yearly = () => {

    const [months, setMonths] = useState([{ key: 1, balance: 0, budget: 0 }]);

    let token = JSON.parse(localStorage.userDetails).token;

    useEffect(() => {
        fetch('http://localhost:5000/plan/year', {
            method: 'GET',
            headers: { "Authorization": `bearer ${token}` },
        })
            .then((response) => response.json())
            .then((responseData) => {
                const keys = Object.values(responseData);
                setMonths([...months, {
                    id: keys.index,
                    budget: keys.budget,
                    balance: keys.balance
                }]);
                console.log(months);
            }).catch((error) => console.log(error.message))
    }, []);

    const elements = [
        { month: 'January', year: '2017', budget: '', balance: '' },
        { month: 'February', year: '2017', budget: '', balance: '' },
        { month: 'March', year: '2017', budget: '', balance: '' },
        { month: 'April', year: '2017', budget: '', balance: '' }];

    // useState - v nachaloto prazen spisak i sledtva se palni

    return (
        <div>
            <Navigation></Navigation>
            <h1>Yearly Balance</h1>
            <div className="yearly">
                {elements.map(el =>
                    <Card month={el.month} year={el.year} budget={el.budget} balance={el.balance}></Card>)}
            </div >
        </div>
    )
}

export default Yearly;
